*
 * 获取客户端存储的已选择书籍(阅读小礼包专用)
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * libSQ.exec('get-gift-cached-book', {
 *   params: {
 *     giftId: '123213',
 *   },
 * }).then((info) => {
 *   alert(`[from ready][get-gift-cached-book][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[from ready][get-gift-cached-book][error] ${JSON.stringify(err, null, 2)}`);
 * });

